I notice a VERY common problem  preppers make when packing. They always seem to pack way too much food and not enough water. You can only last 3 days without water and a lot longer without food. You have a water filtration system which is good but what if you cant find a water source. They say you would use a gallon of water per day I am sure you could go with alittle less depending on the weather and how much you exert yourself bit I think you have way more then 3 days worth of food there plus I believe you need water to prepare those meals! I would sub it out for some water for sure.
After looking at a couple other venders websites, I gave Voodoo a call.  Apparently there is another velcro pocket on the back and a pull tab, near the 2 small D rings, that opens up where you could put a bladder.  I imagine that you can run a para cord though the D rings and the bladder to keep it from collapsing on itself.  So, I bought it and a 3 liter bladder for over half the price of the other vender!  Thanks for reviewing this product.!
